import React from 'react';
import styled from 'styled-components';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {CustomJumbotron} from './components/CustomJumbotron';
import {Footer} from './components/Footer';
import {NewsThumbnail} from './components/NewsThumbnail';

const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;


export const News = () => {
    return (
        <Styles>
            <CustomJumbotron>News</CustomJumbotron>
            <div style = {{ backgroundColor: '#cfcfcf'}}>
                <Container style = {{paddingTop: 50, paddingBottom: 70}} >
                    <Row class = 'justify-content-md-start'>
                        <NewsThumbnail author = 'Forbes'>Next-Gen Educational Tools Deliver A Big Dose Of Fun</NewsThumbnail>
                        <NewsThumbnail author = 'www.huffingtonpost.com'>March MATHness Training</NewsThumbnail>
                        <NewsThumbnail author = 'The Atlantic'>The Math Revolution</NewsThumbnail>
                        <NewsThumbnail author = 'The Atlantic'>The Math Revolution</NewsThumbnail>
                    </Row>
                </Container>
            </div>
            <Footer></Footer>
        </Styles>
    );
}
